script: |
  super -f tsv -I q8839.sql | sort > q8839.out

vector: true

inputs:
  - name: q8839.sql
    data: |
      SELECT 95 AS col0 FROM tab2 AS cor0 WHERE ( - col0 ) NOT IN ( + col2, - col1, + col1 * + col2 - + col2 * - col0 );
  - name: tab2

outputs:
  - name: q8839.out
    data: |
      95
      95
      95
